import React, { Component } from 'react';
import { View, StyleSheet, Animated, Image, TextInput } from 'react-native'

export default function Search() {
    return (
        <div>
           <TextInput></TextInput>
        </div>
    )
}

const styles = StyleSheet.create({
    photo: {
        width: 40,
        height: 40,
        borderRadius: 22
    },
    username: {
        fontSize: 20,
        // fontWeight: 700,
        color: '#F5F5F5'
    }
})
